import React, {Component, Fragment} from "react";

class CafeList extends React.Component{
    render(){
        return(
            <div>
                <input type="search" placeholder="목적지를 검색하세요" value={this.state.place}
          onChange={
            this.handleChange
          } /* 택스트 값이 바뀔때마다 발생하는이벤트 */
        ></input>
            </div>
        )
    }
}

export default CafeList;
